create table dw.dt_date (
date_key int not null,
full_date text,
day_of_week int,
day_num_in_month int,
day_num_overall int,
day_name varchar(100),
day_abbrev char(100),
weekday_flag char(100),
week_num_in_year int,
week_num_overall int,
week_begin_date text,
week_begin_date_key int,
month int,
month_num_overall int,
month_name varchar(100),
month_abbrev char(100),
quarter int,
year int,
yearmo int,
fiscal_month int,
fiscal_quarter int,
fiscal_year int,
last_day_in_month_flag char(100),
same_day_year_ago_date text,
primary key (date_key))
;

